        {menu.map((menuItem) => (
          <MenuItem
            title={menuItem.title}
            isActive={menuItem.isActive}
            link={menuItem.link}
            key={menuItem.id}
          />
        ))}
      </ul>
    </div>
  );
};
export default MenuList;
